    playbackData.comments = {"ev-0":[{"id":"commentId-0","displayCommentEvent":{"id":"ev-0","timestamp":1660848317209,"createdByDevGroupId":"devGroupId-1","eventSequenceNumber":0,"permanentRelevance":"never relevant","type":"CREATE DIRECTORY","directoryId":"dirId-0","directoryPath":"/","parentDirectoryId":null},"developerGroupId":"devGroupId-1","timestamp":1660848317211,"commentText":"<div>In this program I will show you how to write and run a basic Elixir program.&nbsp;</div><div><br></div><div>To begin with you need to install the tools. The online installation instructions are pretty good so I will ask that you follow them <a href=\"https://elixir-lang.org/install.html\">here</a>.</div><div><br></div><div>I'll be referring to the Elixir documentation quite a bit in these programs. Here is a <a href=\"https://hexdocs.pm/elixir/Kernel.html\">link to the docs</a>. Now might be a good time to get familiar with them.<br></div><div><br></div><div>There is a great tool called <a href=\"https://elixir-lang.org/getting-started/mix-otp/introduction-to-mix.html\">Mix</a> which helps you manage large Elixir programs. For simplicity, I am <span style=\"font-style: italic;\">not</span> going to use it in these early programs.&nbsp;Instead I will add <span style=\"font-family: Courier;\">.exs</span> files to a directory and run them with the command line tool <span style=\"font-family: Courier;\">elixir</span>. I will come back to Mix later in this book.<br></div><div><br></div><div>I'll start by creating a file and writing my first Elixir code.<br></div>","commentTitle":"","selectedCodeBlocks":[],"imageURLs":["media/images/1666013570386-image.png","media/images/1662055148602-02.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}],"ev-26":[{"id":"commentId-1","displayCommentEvent":{"id":"ev-26","timestamp":1660848481150,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":26,"type":"INSERT","fileId":"fileId-0","character":")","previousNeighborId":"ev-25","lineNumber":1,"column":25,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1660849759698,"commentText":"<div><a href=\"https://hexdocs.pm/elixir/1.13.4/IO.html\"><span style=\"font-family: Courier;\"></span></a><span style=\"font-family: Courier;\"><a href=\"https://hexdocs.pm/elixir/IO.html\">IO</a></span> is a built in module. Modules hold functions in Elixir. There is a function called <span style=\"font-family: Courier;\"><a href=\"https://hexdocs.pm/elixir/IO.html#puts/2\">puts</a></span><a href=\"https://hexdocs.pm/elixir/1.13.4/IO.html#puts/2\"><span style=\"font-family: Courier;\"></span></a> that will print a string to the screen and then add a newline. For now, all strings will be in double quotes.<br></div><div><br></div><div>On line 1 I am printing the classic text \"Hello World!!!\". If I can get this to run I usually feel pretty good that the install was successful.&nbsp;</div><div><br></div><div>To run an Elixir program:&nbsp;</div><div>- make sure that you have followed the install instructions</div><div>- move to the directory that holds the file that you want to run&nbsp;</div><div>- from the command line, execute this command:</div><div><br></div><div><span style=\"font-family: Courier;\">elixir &lt;filename&gt;.exs</span><br></div><div><br></div><div>The attached picture shows how I ran this program (I moved into the directory that holds 01.exs first and then I issued the command).<br></div><div><br></div><div>Elixir source code files must end with either <span style=\"font-family: Courier;\">.ex</span> or <span style=\"font-family: Courier;\">.exs</span>. Files that end with <span style=\"font-family: Courier;\">.ex</span> are compiled before being executed in the Elixir VM. Files with the extension <span style=\"font-family: Courier;\">.exs</span> are interpreted like scripts.&nbsp;</div><div><br></div><div>Right now the distinction doesn't matter much. I will be using <span style=\"font-family: Courier;\">.exs</span> files in the first part of this book.<br></div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"IO.puts(\"Hello World!!!\")","startRow":0,"startColumn":0,"endRow":0,"endColumn":25}],"imageURLs":["media/images/1660849442253-Screen%20Shot%202022-08-18%20at%201.25.21%20PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/01.exs","viewableBlogText":"IO.puts(\"Hello World!!!\")","commentTags":["image","successful-run"],"questionCommentData":null}],"ev-46":[{"id":"commentId-2","displayCommentEvent":{"id":"ev-46","timestamp":1660848527833,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":46,"type":"INSERT","fileId":"fileId-0","character":"t","previousNeighborId":"ev-45","lineNumber":1,"column":18,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1660849821971,"commentText":"Elixir has comments like many other languages. They begin with a <span style=\"font-family: Courier;\">#</span> and run until the end of the line.<br>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"#this is a comment","startRow":0,"startColumn":0,"endRow":0,"endColumn":18}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":1,"currentFilePath":"/01.exs","viewableBlogText":"#this is a comment\nIO.puts(\"Hello World!!!\")","commentTags":[],"questionCommentData":null}],"ev-71":[{"id":"commentId-3","displayCommentEvent":{"id":"ev-71","timestamp":1660848546294,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":71,"type":"INSERT","fileId":"fileId-0","character":"\"","previousNeighborId":"ev-70","lineNumber":3,"column":24,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1660849920257,"commentText":"When calling a function, parentheses are (mostly) optional. I like them and think they make the code more readable so I will be using them.<br>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"IO.puts \"Hello World!!!\"","startRow":2,"startColumn":0,"endRow":2,"endColumn":24}],"imageURLs":["media/images/1662055273598-03.png"],"videoURLs":[],"audioURLs":[],"linesAbove":2,"linesBelow":0,"currentFilePath":"/01.exs","viewableBlogText":"#this is a comment\nIO.puts(\"Hello World!!!\")\nIO.puts \"Hello World!!!\"","commentTags":["image","successful-run"],"questionCommentData":null}],"ev-103":[{"id":"commentId-4","displayCommentEvent":{"id":"ev-103","timestamp":1660848565617,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":103,"type":"INSERT","fileId":"fileId-0","character":")","previousNeighborId":"ev-102","lineNumber":4,"column":31,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1660849987888,"commentText":"Elixir's string concatenation operator is the <span style=\"font-family: Courier;\">&lt;&gt;</span>. Here I am creating and then printing a new string that is built from two others.<br>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"\"Hello \" <> \"World!!!\"","startRow":3,"startColumn":8,"endRow":3,"endColumn":30}],"imageURLs":["media/images/1662055326491-04.png"],"videoURLs":[],"audioURLs":[],"linesAbove":3,"linesBelow":0,"currentFilePath":"/01.exs","viewableBlogText":"#this is a comment\nIO.puts(\"Hello World!!!\")\nIO.puts \"Hello World!!!\"\nIO.puts(\"Hello \" <> \"World!!!\")","commentTags":["image","successful-run"],"questionCommentData":null}],"ev-115":[{"id":"commentId-5","displayCommentEvent":{"id":"ev-115","timestamp":1660848579713,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":115,"type":"INSERT","fileId":"fileId-0","character":")","previousNeighborId":"ev-114","lineNumber":5,"column":11,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1660850132064,"commentText":"<div>One way to add some separation between the lines of output is to pass <span style=\"font-family: Courier;\">puts</span> an empty string. <span style=\"font-family: Courier;\">puts</span> will automatically add a newline.</div><div><br></div><div>I can also use the newline character, <span style=\"font-family: Courier;\">\\n</span>, in strings to add a new line. I'll do that later on in this program.<br></div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"IO.puts(\"\")","startRow":4,"startColumn":0,"endRow":4,"endColumn":11}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":4,"linesBelow":0,"currentFilePath":"/01.exs","viewableBlogText":"#this is a comment\nIO.puts(\"Hello World!!!\")\nIO.puts \"Hello World!!!\"\nIO.puts(\"Hello \" <> \"World!!!\")\nIO.puts(\"\")","commentTags":[],"questionCommentData":null}],"ev-215":[{"id":"commentId-6","displayCommentEvent":{"id":"ev-215","timestamp":1660848603094,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":215,"type":"INSERT","fileId":"fileId-0","character":")","previousNeighborId":"ev-214","lineNumber":9,"column":38,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1660850279361,"commentText":"<div>There is another built in function called <span style=\"font-family: Courier;\"><a href=\"https://hexdocs.pm/elixir/IO.html#gets/2\">gets</a></span>&nbsp;<a href=\"https://hexdocs.pm/elixir/1.13.4/IO.html#gets/2\"><span style=\"font-family: Courier;\"></span></a>in the <span style=\"font-family: Courier;\"><a href=\"https://hexdocs.pm/elixir/IO.html\">IO</a></span>&nbsp;<a href=\"https://hexdocs.pm/elixir/1.13.4/IO.html\"><span style=\"font-family: Courier;\"></span></a>module.&nbsp;</div><div><br></div><div>It will pause the execution of the program, display the passed in prompt, and then wait for the user to type in something from the keyboard and hit 'enter'.&nbsp;</div><div><br></div><div>That input will be stored in a string and returned from the function. </div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"IO.gets(\"What is your name? \")","startRow":7,"startColumn":11,"endRow":7,"endColumn":41}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":1,"linesBelow":1,"currentFilePath":"/01.exs","viewableBlogText":"#prompt for a name\nraw_name = IO.gets(\"What is your name? \")\nIO.puts(\"Hello \" <> raw_name <> \"!!!\")","commentTags":[],"questionCommentData":null},{"id":"commentId-7","displayCommentEvent":{"id":"ev-215","timestamp":1660848603094,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":215,"type":"INSERT","fileId":"fileId-0","character":")","previousNeighborId":"ev-214","lineNumber":9,"column":38,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1660850795861,"commentText":"<div>This is how you create a variable and set it in Elixir. There is no need to pre-declare it or define a type. This is similar to how variables are defined in Ruby and Python.<br></div><div><br></div><div>When the flow of control gets to line 8 a new variable named <span style=\"font-family: Courier;\">raw_name</span> will spring into existence. In this case it will hold the string that gets returned from the call to <span style=\"font-family: Courier;\">IO.gets</span>.</div><div><br></div><div>The&nbsp;<span style=\"font-family: Courier;\">=</span> operator (called the match operator) is really interesting in Elixir. It is actually just binding a name to a value. In this case, the name <span style=\"font-family: Courier;\">raw_name</span> is bound to the value that the user types when the flow of control reaches line 8. I'll come back to the match operator in future programs but for now you can think of this like a normal data assignment.<br></div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"raw_name =","startRow":7,"startColumn":0,"endRow":7,"endColumn":10}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":1,"linesBelow":1,"currentFilePath":"/01.exs","viewableBlogText":"#prompt for a name\nraw_name = IO.gets(\"What is your name? \")\nIO.puts(\"Hello \" <> raw_name <> \"!!!\")","commentTags":[],"questionCommentData":null},{"id":"commentId-8","displayCommentEvent":{"id":"ev-215","timestamp":1660848603094,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":215,"type":"INSERT","fileId":"fileId-0","character":")","previousNeighborId":"ev-214","lineNumber":9,"column":38,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1660851004034,"commentText":"<div>On line 9, I concatenate the different strings together to welcome someone by name.&nbsp;</div><div><br></div><div>The attached screenshot shows the output. It looks a little funny because the <span style=\"font-family: Courier;\">!!!</span> are on a different line. This is because <span style=\"font-family: Courier;\">gets</span> returns the newline associated with the user hitting the 'enter' key.&nbsp;</div><div><br></div><div>I think I want to get rid of that. Luckily, Elixir has a function for that!<br></div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"IO.puts(\"Hello \" <> raw_name <> \"!!!\")","startRow":8,"startColumn":0,"endRow":8,"endColumn":38}],"imageURLs":["media/images/1662055689279-05.png"],"videoURLs":[],"audioURLs":[],"linesAbove":2,"linesBelow":0,"currentFilePath":"/01.exs","viewableBlogText":"#prompt for a name\nraw_name = IO.gets(\"What is your name? \")\nIO.puts(\"Hello \" <> raw_name <> \"!!!\")","commentTags":["successful-run","image"],"questionCommentData":null}],"ev-249":[{"id":"commentId-9","displayCommentEvent":{"id":"ev-249","timestamp":1660848624221,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":249,"type":"DELETE","fileId":"fileId-0","character":"r","previousNeighborId":"ev-198","lineNumber":10,"column":21},"developerGroupId":"devGroupId-2","timestamp":1660851455826,"commentText":"<div>The<span style=\"font-family: Courier;\"><a href=\"https://hexdocs.pm/elixir/1.13.4/String.html\"></a></span> <span style=\"font-family: Courier;\"><a href=\"https://hexdocs.pm/elixir/String.html\">String</a></span> module includes a function called <span style=\"font-family: Courier;\"><a href=\"https://hexdocs.pm/elixir/String.html#trim/1\">trim</a></span> that will remove all of the leading and trailing whitespace characters (including newlines) on either end of a string.&nbsp;</div><div><br></div><div>The function returns a new string with the whitespace&nbsp;removed. I store the new string in a different variable, called <span style=\"font-family: Courier;\">name</span>. Then I print it on line 10 using the new variable instead of <span style=\"font-family: Courier;\">raw_name</span>.<br></div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"name = String.trim(raw_name)","startRow":8,"startColumn":0,"endRow":8,"endColumn":28},{"fileId":"fileId-0","selectedText":"name","startRow":9,"startColumn":20,"endRow":9,"endColumn":24}],"imageURLs":["media/images/1662055833477-06.png"],"videoURLs":[],"audioURLs":[],"linesAbove":1,"linesBelow":0,"currentFilePath":"/01.exs","viewableBlogText":"raw_name = IO.gets(\"What is your name? \")\nname = String.trim(raw_name)\nIO.puts(\"Hello \" <> name <> \"!!!\")","commentTags":["image","successful-run"],"questionCommentData":null}],"ev-294":[{"id":"commentId-10","displayCommentEvent":{"id":"ev-294","timestamp":1660848648155,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":294,"type":"INSERT","fileId":"fileId-0","character":"\"","previousNeighborId":"ev-293","lineNumber":10,"column":28,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1660851936743,"commentText":"<div>Elixir's <a href=\"https://en.wikipedia.org/wiki/String_interpolation\"><span style=\"font-style: italic;\">string interpolation</span></a>&nbsp;makes it a lot easier to mix values with strings.&nbsp;</div><div><br></div><div>Anywhere there is a <span style=\"font-family: Courier;\">#{}</span> in a string, the value produced by the code inside the curlys will replace it.&nbsp;</div><div><br></div><div>I got rid of the concatenation. This reads a lot better to me&nbsp;and is much easier to write than using all of those <span style=\"font-family: Courier;\">&lt;&gt;</span>.<br></div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"\"Hello #{name}!!!\\n\"","startRow":9,"startColumn":8,"endRow":9,"endColumn":28}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":3,"linesBelow":0,"currentFilePath":"/01.exs","viewableBlogText":"#prompt for a name\nraw_name = IO.gets(\"What is your name? \")\nname = String.trim(raw_name)\nIO.puts(\"Hello #{name}!!!\\n\")","commentTags":[],"questionCommentData":null}],"ev-634":[{"id":"commentId-11","displayCommentEvent":{"id":"ev-634","timestamp":1660848701474,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":634,"type":"INSERT","fileId":"fileId-0","character":")","previousNeighborId":"ev-633","lineNumber":21,"column":51,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1660852379221,"commentText":"<div>Next,&nbsp;I prompt for an age and print it. Then I'll print&nbsp;what the age will be in 10 years.&nbsp;</div><div><br></div><div><span style=\"font-family: Courier;\">gets</span> always returns a string so I trim it and then convert it into an integer using the <span style=\"font-family: Courier;\"><a href=\"https://hexdocs.pm/elixir/String.html#to_integer/1\">to_integer</a></span>&nbsp;<a href=\"https://hexdocs.pm/elixir/1.13.4/String.html#to_integer/1\"><span style=\"font-family: Courier;\"></span></a>function in the<a href=\"https://hexdocs.pm/elixir/1.13.4/String.html\"><span style=\"font-family: Courier;\"></span></a> <span style=\"font-family: Courier;\">String</span> module.</div><div><br></div><div>Afterwards I'll be able to do some math with the result held in the variable named <span style=\"font-family: Courier;\">age</span>. I wouldn't be able to do arithmetic on a string.<br></div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"age = String.to_integer(age_string)\n","startRow":16,"startColumn":0,"endRow":17,"endColumn":0}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":5,"linesBelow":3,"currentFilePath":"/01.exs","viewableBlogText":"#prompt for an age\nraw_age = IO.gets(\"How old are you? \")\n#remove any leading and trailing spaces\nage_string = String.trim(raw_age)\n#convert the string to an int so that I can do some math\nage = String.to_integer(age_string)\n\nIO.puts(\"\")\nIO.puts(\"Right now #{name} is #{age} years old.\")\nIO.puts(\"In ten years #{name} will be #{age + 10}\")","commentTags":[],"questionCommentData":null},{"id":"commentId-12","displayCommentEvent":{"id":"ev-634","timestamp":1660848701474,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":634,"type":"INSERT","fileId":"fileId-0","character":")","previousNeighborId":"ev-633","lineNumber":21,"column":51,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1660852477721,"commentText":"<div>Lines 20-21 is where I am using string interpolation with the <span style=\"font-family: Courier;\">name</span> and <span style=\"font-family: Courier;\">age</span>.&nbsp;</div><div><br></div><div>At the end of line 21, I am performing some arithmetic with the <span style=\"font-family: Courier;\">age</span> (see the attached screenshot).</div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"#{name}","startRow":19,"startColumn":19,"endRow":19,"endColumn":26},{"fileId":"fileId-0","selectedText":"#{age}","startRow":19,"startColumn":30,"endRow":19,"endColumn":36},{"fileId":"fileId-0","selectedText":"#{name}","startRow":20,"startColumn":22,"endRow":20,"endColumn":29},{"fileId":"fileId-0","selectedText":"#{age + 10}","startRow":20,"startColumn":38,"endRow":20,"endColumn":49}],"imageURLs":["media/images/1662056245447-08.png"],"videoURLs":[],"audioURLs":[],"linesAbove":1,"linesBelow":0,"currentFilePath":"/01.exs","viewableBlogText":"IO.puts(\"\")\nIO.puts(\"Right now #{name} is #{age} years old.\")\nIO.puts(\"In ten years #{name} will be #{age + 10}\")","commentTags":["image","successful-run"],"questionCommentData":null}],"ev-948":[{"id":"commentId-13","displayCommentEvent":{"id":"ev-948","timestamp":1660848748491,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":948,"type":"INSERT","fileId":"fileId-0","character":"r","previousNeighborId":"ev-947","lineNumber":15,"column":22,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1660853020032,"commentText":"<div>Did you notice in the last step that I had to use a few variables to hold the intermediate values,&nbsp;<span style=\"font-family: Courier;\">raw_age</span> and <span style=\"font-family: Courier;\">age_string?</span> See the first attached screenshot or go to the previous comment. <br></div><div><br></div><div>Elixir has a 'pipe' operator, <span style=\"font-family: Courier;\">|&gt;</span>, that allows you to chain function calls together. It feeds the return value of one function forward into the arguments of the next function.</div><div><br></div><div>After using the pipe, I don't need those intermediate variables anymore. The pipe operator always feeds the return value forward as the first argument of the next function call. The final function's return value is returned and stored in <span style=\"font-family: Courier;\">age</span> on line 13 (see the second attached picture).&nbsp;</div><div><br></div><div>The output is the same as before (see the third attached screenshot).<br></div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"|>","startRow":13,"startColumn":2,"endRow":13,"endColumn":4},{"fileId":"fileId-0","selectedText":"|>","startRow":14,"startColumn":2,"endRow":14,"endColumn":4}],"imageURLs":["media/images/1660945077172-image.png","media/images/1660852909282-01.jpeg","media/images/1660853017404-Screen%20Shot%202022-08-18%20at%201.30.32%20PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":2,"linesBelow":0,"currentFilePath":"/01.exs","viewableBlogText":"#pipe operator\nage = IO.gets(\"How old are you? \")\n  |> String.trim\n  |> String.to_integer","commentTags":["image","successful-run"],"questionCommentData":null}]};
